import React, { useState } from 'react';
import Sidebar from '../components/CustSidebar';
import './RequestService.css';

const RequestService: React.FC = () => {
  const [form, setForm] = useState({
    make: '', model: '', year: '', name: '', email: '', phone: '', date: '', time: '', details: ''
  });
  const [selected, setSelected] = useState<number[]>([]);
  
  const makes = ['Toyota', 'Honda', 'Ford', 'Chevrolet', 'BMW'];
  const models = {
    Toyota: ['Camry', 'Corolla', 'RAV4'],
    Honda: ['Civic', 'Accord', 'CR-V'],
    Ford: ['F-150', 'Escape', 'Explorer'],
    Chevrolet: ['Silverado', 'Equinox', 'Malibu'],
    BMW: ['3 Series', '5 Series', 'X3']
  };
  
  const services = [
    { id: 1, name: 'Oil Change', desc: 'Full oil change', cost: 49.99 },
    { id: 2, name: 'Tire Rotation', desc: 'Even tire wear', cost: 29.99 },
    { id: 3, name: 'Brake Inspection', desc: 'Brake system check', cost: 39.99 }
  ];

  const years = Array.from({length: 21}, (_, i) => new Date().getFullYear() - i);
  const total = services.reduce((a, c) => selected.includes(c.id) ? a + c.cost : a, 0);

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log({...form, services: selected});
    alert('Request submitted!');
  };

  return (
    <div className="app">
      <Sidebar />
      <div className="main">
        <h1>Request Service</h1>
        
        <form onSubmit={handleSubmit}>
          <fieldset>
            <h2>Vehicle</h2>
            <div className="row">
              <select 
                value={form.make} 
                onChange={e => setForm({...form, make: e.target.value})} 
                required
              >
                <option value="">Select Make</option>
                {makes.map(m => <option key={m} value={m}>{m}</option>)}
              </select>
              
              <select 
                value={form.model} 
                onChange={e => setForm({...form, model: e.target.value})} 
                required 
                disabled={!form.make}
              >
                <option value="">Select Model</option>
                {form.make && models[form.make as keyof typeof models]?.map(m => 
                  <option key={m} value={m}>{m}</option>)}
              </select>
              
              <select 
                value={form.year} 
                onChange={e => setForm({...form, year: e.target.value})} 
                required
              >
                <option value="">Select Year</option>
                {years.map(y => <option key={y} value={y}>{y}</option>)}
              </select>
            </div>
          </fieldset>

          <fieldset>
            <h2>Services</h2>
            <div className="grid">
              {services.map(s => (
                <div 
                  key={s.id} 
                  className={`card ${selected.includes(s.id) ? 'active' : ''}`} 
                  onClick={() => setSelected(p => p.includes(s.id) ? p.filter(id => id !== s.id) : [...p, s.id])}
                >
                  <div>
                    <input type="checkbox" checked={selected.includes(s.id)} readOnly />
                    <span>{s.name}</span>
                  </div>
                  <p>{s.desc}</p>
                </div>
              ))}
            </div>
          </fieldset>

          <fieldset>
            <h2>Appointment</h2>
            <div className="row">
              <input 
                type="date" 
                value={form.date} 
                onChange={e => setForm({...form, date: e.target.value})} 
                required 
                min={new Date().toISOString().split('T')[0]} 
              />
              <select 
                value={form.time} 
                onChange={e => setForm({...form, time: e.target.value})} 
                required
              >
                <option value="">Select Time</option>
                {['Morning (8-12)', 'Afternoon (12-4)', 'Evening (4-7)'].map(t => 
                  <option key={t} value={t}>{t}</option>)}
              </select>
            </div>
          </fieldset>

          <fieldset>
            <h2>Contact</h2>
            <div className="row">
              <input 
                placeholder="Full Name" 
                value={form.name} 
                onChange={e => setForm({...form, name: e.target.value})} 
                required 
              />
              <input 
                placeholder="Phone" 
                type="tel" 
                value={form.phone} 
                onChange={e => setForm({...form, phone: e.target.value})} 
                required 
              />
            </div>
            <input 
              placeholder="Email" 
              type="email" 
              value={form.email} 
              onChange={e => setForm({...form, email: e.target.value})} 
              required 
            />
          </fieldset>

          <fieldset>
            <h2>Details</h2>
            <textarea 
              placeholder="Describe issues..." 
              value={form.details} 
              onChange={e => setForm({...form, details: e.target.value})} 
            />
          </fieldset>

          <div className="total">
            Total: ${total.toFixed(2)}
            <div>
              <button type="button">Cancel</button>
              <button type="submit" className="primary">Submit</button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
};

export default RequestService;
